    <title>Redirectingâ€¦</title>
    <link rel="canonical" href="https://vaccinatethestates.com/embed">

  <body>
    <script>
      var url = 'https://vaccinatethestates.com/embed';
      if (location.search && url.indexOf('?') === -1) {
        url = url.replace(/($|#)/, location.search + '$1');
      }
      if (location.hash && url.indexOf('#') === -1) {
        url += location.hash;
      }
      location=url;
    </script>
  </body>
